/* This file will support a page that lists and describes the courses I have taken */

import { View, StyleSheet, Text } from "react-native";
import React from "react";

import TopBar from "./TopBar";

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignContent: "center",
        justifyContent: "center"
    },
    courseName: {
        fontFamily: "Iceland",
        fontSize: 40,
        fontStyle: "italic",
        textDecorationLine: "underline",
        justifyContent: "center",
        alignContent: "center"
    },
    courseDesc: {
        fontFamily: "Arial",
        fontSize: 15,
    },
    fadeFromLeft: {
        //flexDirection: "row",
        alignContent: "center",
        justifyContent: "center"
    },
    fadeFromRight: {
        alignContent: "center",
        justifyContent: "center"
    }

})

function Courses() {
    return(
        <View>
            <TopBar></TopBar>
            <View style={{padding: 35}}></View>
            <View style={styles.container}>
                <View style={styles.fadeFromLeft}>
                    <Text style={styles.courseName}>CSE 115</Text>
                    <Text style={styles.courseDesc}>In this course</Text>
                </View>
            </View>
        </View>
    )
}

export default Courses;
